              )}
              <div id="image-display"></div>
              <img id="image-output" src={this.state.imgSrc}></img>
            </div>
          </div>
        </>
      );
    } else if (this.path == "tree") {
      return (
        <>
          <h1>{post.title}</h1>
          <hr></hr>
          <div className="row">
            <div className="col-6">
              <form>
                <div className="form-group row">
                  <label className="col-sm-2 col-form-label">
