                  </label>
                  <div className="col-sm-10">
                    <input
                      className="form-control"
                      placeholder="3"
                      type="text"
                      name="depthlimit"
                      onChange={this.onChange.bind(this)}
                    />
                  </div>
                  <label className="col-sm-2 col-form-label">
                    {" "}
                    Example Limit:{" "}
                  </label>
                  <div className="col-sm-10">
                    <input
                      className="form-control"
                      placeholder="3"
